ame, address, email and phone number, which will be used to populate the checkout for future orders.'=>'Ja izveidosit kontu, mēs saglabāsim jūsu vārdu, adresi, e-pasta adresi un tālruņa numuru, ko izmantos, lai aizpildītu norēķināšanos nākotnes pasūtījumu veikšanā.','Send you marketing messages, if you choose to receive them'=>'Nosūtīt jums mārketinga ziņas, ja jūs izvēlaties tādas saņemt','Improve our store offerings'=>'Uzlabot mūsu veikala piedāvājumu','Comply with any legal obligations we have, such as calculating taxes'=>'Ievērojiet visus juridiskos pienākumus, piemēram, nodokļu aprēķināšanu','Set up your account for our store'=>'Izveidojiet savu kontu mūsu veikalā','Process payments and prevent fraud'=>'Apstrādāt maksājumus un novērst krāpšanos','Respond to your requests, including refunds and complaints'=>'Atbildēt uz jūsu pieprasījumiem, ieskaitot atmaksas un sūdzības','Send you information about your account and order'=>'Sūtīt informāciju par jūsu kontu un pasūtījumu','When you purchase from us, we’ll ask you to provide information including your name, billing address, shipping address, email address, phone number, credit card/payment details and optional account information like username and password. We’ll use this information for purposes, such as, to:'=>'Kad jūs iepērkaties pie mums, mēs lūgsim jums sniegt informāciju, tostarp jūsu vārdu, norēķinu adresi, piegādes adresi, e-pasta adresi, tālruņa numuru, informāciju par kredītkarti / maksājumu un papildu informāciju par kontu, piemēram, lietotājvārdu un paroli. Mēs izmantosim šo informāciju tādiem mērķiem kā, piemēram:','Note: you may want to further detail your cookie policy, and link to that section from here.'=>'Piezīme. Iespējams, vēlēsieties detalizēt sīkfailu politiku un šeit norādīt saiti uz šo sadaļu.','We’ll also use cookies to keep track of cart contents while you’re browsing our site.'=>'Mēs arī izmantosim sīkdatnes, lai sekotu groza saturam, kamēr jūs pārlūkojat mūsu vietni.','Location, IP address and browser type: we’ll use this for purposes like estimating taxes and shipping'=>'Atrašanās vieta, IP adrese un pārlūkprogrammas tips: mēs izmantosim to tādiem mērķiem kā, piemēram, nodokļu un piegādes aprēķināšanai','Products you’ve viewed: we’ll use this to, for example, show you products you’ve recently viewed'=>'Produkti, kurus esat aplūkojis: mēs to izmantosim, lai parādītu jūsu nesen skatītos produktus','What we collect and store'=>'Ko mēs savācam un uzglabājam','We collect information about you during the checkout process on our store.'=>'Mēs apkopojam informāciju par jums mūsu veikala norēķinu procesā.','While you visit our site, we’ll track:'=>'Kamēr apmeklējat mūsu vietni, mēs izsekojam:','Items Purchased'=>'Produkts Nopirkts','Order Number'=>'Pasūtījuma numurs','Access granted'=>'Pieeja atļauta','User email'=>'Lietotāja epasts','Download count'=>'Lejupielāžu skaits','Token'=>'Žetons','Payment Tokens'=>'Maksājumu žetoni','Browser User Agent'=>'Pārlūkprogrammas lietotāja aģents','Personal data removed.'=>'Personas dati ir dzēsti.','Shipping State'=>'Piegādes Štats','Shipping Postal/Zip Code'=>'Piegādes Pasta Indekss','Shipping City'=>'Piegādes Pilsēta','Shipping Company'=>'Piegādes Kompānija','Shipping Last Name'=>'Piegādes Uzvārds','Shipping First Name'=>'Piegādes Vārds','Phone Number'=>'Telefona Numurs','Billing State'=>'Rēķina Štats','Billing Postal/Zip Code'=>'Rēķina Pasta Indeks','Billing City'=>'Rēķina Pilsēta','Billing Company'=>'Rēķina Kompānija','Billing Last Name'=>'Rēķina Uzvārds','Billing First Name'=>'Rēķina Vārds','Download ID'=>'Lejuplādes ID','Customer Data'=>'Klienta Dati','Display name'=>'Parādāmais Vārds','display name%1$s %2$s'=>'%1$s %2$s','Name of the customer for the order'=>'Klienta Vārds pasūtījumam','Customer download permissions have been retained.'=>'Klienta lejupielādes atļaujas ir saglabātas.','Removed access to downloadable files.'=>'Noņemta piekļuve lejupielādējamiem failiem.','Removed personal data from order %s.'=>'