egory. Instead, products that were only assigned to the deleted category are set to the category %s.'=>'Dzēšot kategoriju, šajā kategorijā netiek izdzēsti produkti. Tā vietā produktiem, kas tika piešķirti tikai svītrotajai kategorijai, tiek noteikta šī kategorija %s.','%s quantity'=>'%s daudzums','Pay for this order'=>'Maksāt par šo pasūtījumu','1:1'=>'1:1','Main image width'=>'Galvenā attēla platums','Product Catalog'=>'Produktu katalogs','Buy &ldquo;%s&rdquo;'=>'Pirkt &ldquo;%s&rdquo;','Store Notice'=>'Veikala paziņojums','View products in the &ldquo;%s&rdquo; group'=>'Skatīt produktus &ldquo;%s&rdquo; grupā','Select options for &ldquo;%s&rdquo;'=>'Izvēlieties opcijas priekš &ldquo;%s&rdquo;','The maximum allowed setting is %d'=>'Maksimāli pieļaujamais iestatījums ir %d','Enable store notice'=>'Iespējot veikala paziņojumu','Choose what to display on the main shop page.'=>'Izvēlieties, ko parādīt galvenajā veikala lapā.','Category display'=>'Kategorijas skats','Choose what to display on product category pages.'=>'Izvēlieties, ko parādīt produkta kategorijas lapās.','How should products be sorted in the catalog by default?'=>'Kā pēc noklusējuma produktiem jābūt sakārtotim katalogā?','Products per row'=>'Preces skaits rindā','How many products should be shown per row?'=>'Cik daudz produktu ir jāparāda katrā rindā?','Rows per page'=>'Rindas vienā lappusē','How many rows of products should be shown per page?'=>'Cik daudz rindu ar produktiem ir jāparāda vienā lappusē?','Product Images'=>'Produkta attēli','Image size used for the main image on single product pages. These images will remain uncropped.'=>'Attēlu lielums, kas tiek izmantots galvenajam attēlam viena produkta lapās. Šie attēli paliks nemainīgi.','Thumbnail width'=>'Sīktēlu platums','Thumbnail cropping'=>'Sīktēlu apgriešana','Images will be cropped into a square'=>'Attēli tiks izgriezti kvadratā','Images will be cropped to a custom aspect ratio'=>'Attēli tiks apgriezti pēc pielāgotas malu attiecības','Uncroppe