ue with Jetpack'=>'Turpiniet ar Jetpack','Reasons you\'ll love Jetpack'=>'Iemesli, kādēļ jums patiks Jetpack','Webhook topic unknown. Please select a valid topic.'=>'Webhook tēma nav zināma. Lūdzu, izvēlieties derīgu tēmu.','Square'=>'Kvadrāts','Klarna Payments'=>'Klarna maksājumi','Direct payments to email address:'=>'Tiešais maksājums uz e-pasta adresi:','Email address to receive payments'=>'E-pasta adrese maksājumu saņemšanai','Klarna Checkout'=>'Klarna Apmaksa','Choose the payment that you want, pay now, pay later or slice it. No credit card numbers, no passwords, no worries. <a href="%s" target="_blank">Learn more about Klarna</a>.'=>'Izvēlieties vēlamo maksājumu, maksājiet tūlīt, samaksājiet vēlāk vai sagrieziet to. Nav kredītkaršu numuri, nav paroļu, nav jāuztraucas. <a href="%s" target="_blank">Uzziniet vairāk par Klarna</a>.','Securely accept credit and debit cards with one low rate, no surprise fees (custom rates available). Sell online and in store and track sales and inventory in one place. <a href="%s" target="_blank">Learn more about Square</a>.'=>'Droši pieņemt kredītkartes un debetkartes ar vienu zemu likmi, bez slēptiem maksājumiem (pieejamas pasūtījuma likmes). Pārdodiet tiešsaistē vai veikalā un veiciet pārdošanas un inventāra glabāšanu, un reģistrēšanu vienā vietā. <a href="%s" target="_blank">Uzziniet vairāk par Square</a>.','Customer downloads'=>'Klientu lejupielādes','Revision restored.'=>'Revīzija atjaunota.','I will also be selling products or services in person.'=>'Es arī personīgi pārdod produktus vai pakalpojumus.','Accept debit and credit cards in 135+ currencies, methods such as Alipay, and one-touch checkout with Apple Pay. <a href="%s" target="_blank">Learn more</a>.'=>'Pieņemiet debetkartes un kredītkartes 135+ valūtās, tādas metodes kā Alipay un viena pieskāriena izrakstīšanās ar Apple Pay. <a href="%s" target="_blank">Uzzināt vairāk
