ntact us if you are having difficulty finding your order details.'=>'Atvainojiet, pasūtījumu nevarēja atrast. Lūdzu, sazinieties ar mums, ja jums ir grūti atrast jūsu pasūtījuma informāciju.','Display the customer shopping cart.'=>'Parādiet klienta iepirkumu grozu.','Display a list of active product filters.'=>'Parādiet aktīvo produktu filtru sarakstu.','Filter Products by Attribute'=>'Filtrēt produktus pēc atribūtiem','Filter Products by Price'=>'Filtrēt produktus pēc cenas','Recent Product Reviews'=>'Jaunākās produktu atsauksmes','Display a list of a customer\'s recently viewed products.'=>'Parādiet klienta nesen skatīto produktu sarakstu.','There are no shipping options available. Please ensure that your address has been entered correctly, or contact us if you need any help.'=>'Nav pieejamai piegādes veidi. Lūdzu, pārliecinieties, ka jūsu adrese ir ievadīta pareizi, vai sazinieties ar mums, ja jums nepieciešama palīdzība.','This option will delete ALL of your tax rates, use with caution. This action cannot be reversed.'=>'Šī opcija izdzēsīs VISAS jūsu nodokļu likmes, izmantojiet piesardzīgi. Šo darbību nevar atgriezt.','Delete tax rates'=>'Dzēst nodokļu likmes','Create pages'=>'Izveidot lapas','Create default WooCommerce pages'=>'Izveidot noklusējuma WooCommerce lapas','Clear customer sessions'=>'Notīrīt klientu sesijas','An additional, optional address line for your business location.'=>'Papildu izvēles adrešu līnija jūsu uzņēmuma atrašanās vietai.','The street address for your business location.'=>'Jūsu uzņēmuma atrašanās vietas adrese.','Store Address'=>'Veikala Adrese','Update now'=>'Atjaunināt tagad','The following active plugin(s) have not declared compatibility with WooCommerce %s yet and should be updated and examined further before you proceed:'=>'Sekojošais aktīvais spraudnis (-i) vēl nav deklarējis savietojamību ar WooCommerce %s, un pirms turpināt, tas ir jāatjaunina un jāpārbauda.','Tested up to WooCommerce version'=>'Testēts līdz WooCommerce versijai','Plugin'=>'Spraudnis','unknown'=>'nezināms','<strong>Heads up!</strong> The versions of the following plugins you\'re running haven\'t been tested with WooCommerce %s. Please update them or confirm compatibility before updating WooCommerce, or you may experience issues:'=>'<strong> Uzmanību! </strong> Šo izmantoto spraudņu versijas nav pārbaudītas ar WooCommerce %s. Lūdzu atjauniniet vai apstipriniet saderību pirms WooCommerce atjaunināšanas, vai arī var rasties problēmas:','WooCommerce transients'=>'WooCommerce pārejas procesi','Page settingTerms and conditions'=>'Noteikumi un nosacījumi','Post Type Counts'=>'Rakstu Tipa Skaitļi','%s failed. Contact your hosting provider.'=>'%s neizdevās. Sazinieties ar savu hostinga pakalpojumu sniedzēju.','Forcing downloads will keep URLs hidden, but some servers may serve large files unreliably. If supported, %1$s / %2$s can be used to serve downloads instead (server requires %3$s).'=>'Lejupielāžu uzstāšana uzturēs URL vietrāžus neredzamus, taču daži serveri var neizsniegt lielus failus. Ja tiek atbalstīts, lai izsniegtu lejupielādes, var izmantot %1$s / %2$s (serverim ir nepieciešams %3$s).','The postal code, if any, in which your business is located.'=>'Pasta indekss, ja tāds ir, kurā atrodas jūsu uzņēmums.','The country and state or province, if any, in which your business is located.'=>'Valsts un, ja tādi ir, štats vai province, kurā atrodas jūsu uzņēmums.','The city in which your business is located.'=>'Pilsēta, kurā atrodas jūsu uzņēmums.','%s fee'=>'%s maksa','Country / State'=>'Valsts / Pavalsts','This is where your business is located. Tax rates and shipping rates will use this address.'=>'Šeit atrodas jūsu uzņēmums. Nodokļu likmes un nosūtīšanas cenas izmantos šo adresi.','Total Database Size'=>'Kopējais datu bāzes lielums','Database Data Size'=>'Datu bāzes datu izmērs','Database Index Size'=>'Datubāzes indeksa izmērs','Refund #%1$s - %2$s by %3$s'=>'Atmaksāt #%1$s - %2$s par %3$s','Add shipping'=>'Pievienot piegād